import {BrowserRouter, Routes, Route, createBrowserRouter, RouterProvider} from "react-router-dom"
import Students from "./pages/student.jsx"
import Navbar from "./comp/navbar.jsx"
import Lecturers from "./pages/lecturer.jsx";
import Departments from "./comp/department.jsx";
import Login from "./pages/login.jsx";
import Add from "./pages/addStudent.jsx"
import './App.css';

const router = createBrowserRouter([
  {
    path: "/",
    element:
      <div>
        <Navbar />
      </div>
  },
  {
    path: "/login",
    element:
      <Login/>
  },
  {
    path: "/allstudents",
    element:
    <div>
      <Navbar/>
      <Students/>
    </div>
  }, 
  {
    path: "/alllecturers",
    element:  
    <div>
      <Navbar/>
      <Lecturers/>
    </div>
  },
  {
    path: "/alldepartments",
    element:  
    <div>
      <Navbar/>
      <Departments/>
    </div>  
  },
  {
    path:"/addStudent",
    element: <Add/>
  }
]);

function App() {
  return (
    <div className="App"> 
        <RouterProvider router = {router}/>
    </div>
  );
}

export default App;
